            <div>
                {/* Ana Sayfa Body Kısmı */}
                <div id="fullpage">
                    <div className="bg section s1">
                        <div className="caption-container">
                            <a href="#">
                                <div className="caption">
                                    <small>Tüm Basic Tişörtlerde</small>
                                    <h4>3 AL 2 ÖDE</h4>
                                </div>
                            </a>
                        </div>

                        <div className="cover"></div>

                    </div>
                </div>
            </div>
        )
    }
}
export default Body;
